import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/navbar-styles.css'; // 引入外部的CSS文件
import { Navbar, Nav, NavDropdown } from 'react-bootstrap'; // 引入 React Bootstrap 组件

function AppNavbar({ setTtsService }) {
  return (
    <Navbar bg="info" variant="dark" expand="lg">
      <Navbar.Brand as={Link} to="/">
        <img src="/logo512.png" alt="Logo" className="logo" /> 智能面试小助手
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="ml-auto ml-lg-auto">
          <Nav.Link as={Link} to="/history">练习记录</Nav.Link>
          <select onChange={(e) => setTtsService(e.target.value)}>
            <option value="minimax">Minimax TTS</option>
            <option value="openai">OpenAI TTS</option>
            <option value="browser">浏览器 TTS</option>
          </select> 
          <Nav.Link as={Link} to="/login" className="ml-lg-auto">登录</Nav.Link>
        </Nav>

      </Navbar.Collapse>
    </Navbar>
  );
}

export default AppNavbar;
